func checkStrings(s1 string, s2 string) bool {
    // Initialize maps to count occurrences of each character
    // at odd and even indices for both strings.
    oddCount1 := make(map[byte]int)
    evenCount1 := make(map[byte]int)
    oddCount2 := make(map[byte]int)
    evenCount2 := make(map[byte]int)

    // Count the occurrences of each character at odd and even indices for s1 and s2.
    for i := 0; i < len(s1); i++ {
        if i%2 == 0 { // Even index
            evenCount1[s1[i]]++
            evenCount2[s2[i]]++
        } else { // Odd index
            oddCount1[s1[i]]++
            oddCount2[s2[i]]++
        }
    }

    // Check if the counts match for odd and even indices separately.
    for char, count := range oddCount1 {
        if oddCount2[char] != count {
            return false
        }
    }
    for char, count := range evenCount1 {
        if evenCount2[char] != count {
            return false
        }
    }

    // If all counts match, it is possible to make s1 and s2 equal.
    return true
}
